EVTNAME986501;The Rise of Bedr Khan;;;;;;;;;;;;;
EVTDESC986501;We had no sooner reached the house of Yakoub Rais, then a cry of The bey has come spread through the village. The village was in the greatest alarm at a threatened invasion from Bedr Khan. The district of Tkhoma, which had escaped the former massacre, was now the object of his fanatical vengeance." Bedr Khan is the young and ambitious ruler of the Emirate of Bohtan. During the war with Egypt, Turkish troops were preoccupied with invading Egyptian troops and were unable to suppress his revolt, a reaction to the modernizing and centralizing efforts of Sultan Mahmud II that were antagonized by the Kurdish feudal chiefs. As a result, he extended his authority up to Mahabad, with Kurdish tribes pledging fealty to him. He adopted the fanatical tenets of Darwishes and was encouraged to undertake mass slaughters against Assyrians and Yazidis in the territory he controlled. The young leader was so bold as to invade kurdish lands in our country, an unmistakable act of war.
